{
    "$schema": "https://json-schema.org/draft/2019-09/schema",
    "$id": "https://example.com/transfer.schema.json",
    "title": "Transfer",
    "description": "A transfer conducted by an account.",
    "type": "object",
    "properties": {
        "transactionNum": {
            "description": "The unique identifier of the transaction.",
            "type": "integer"
        },
        "sourceAccountNum": {
            "description": "The unique identifer of the source account.",
            "type": "integer"
        },
        "targetAccountNum": {
            "description": "The unique identifer of the source account.",
            "type": "integer"
        },
        "transactionType": {
            "description": "The transaction type.",
            "type": "string"
        },
        "amount": {
            "description": "The transaction amount.",
            "type": "number"
        },
        "currency": {
            "description": "The currency of the transaction.",
            "type": "string"
        },
        "transferDateTime": {
            "description": "When should the transfer be done.",
            "type": "string"
        },
        "timestamp": {
            "description": "The time stamp of the event.",
            "type": "string"
        }
    },
    "required": [
        "transactionNum",
        "sourceAccountNum",
        "targetAccountNum",
        "transactionType",
        "amount",
        "currency",
        "transferDateTime",
        "timestamp"
    ]
}

